    false,nt"url": null,nt"notes": "The "Syria Refugee Sites" dataset is
    compiled by the U.S. Department of State, Humanitarian Information Unit (INR/GGI/HIU).
    This dataset contains open source derived data about the geographic location (point
    geometry), name, and operational status of refugee sites hosting Syrian refugees
    in Turkey, Jordan, and Iraq. Only refugee sites operated by the United Nations High
    Commissioner for Refugees (UNHCR) or the Government of Turkey are included. Compiled
    by the U.S Department of State, Humanitarian Information Unit (HIU), each attribute
    in the dataset (including name, location, and status) is verified against multiple
    sources. The name and status are obtained from UN and AFAD reporting and the UNHCR
    data portal (accessible at http://data.unhcr.org/syrianrefugees/regional.php). The
    locations are obtained from both the U.S. Department of State, PRM and the National
    Geospatial-Intelligence Agency's GEOnet Names Server (GNS) (accessible at http://geonames.nga.mil/ggmagaz/).
    The name and status for each refugee site is verified with PRM.  Locations are verified
    using high-resolution commercial satellite imagery and/or known areas of population.
    Additionally, all data is checked against various news sources. The data contained
    herein is entirely unclassified and is current as of 14 January 2016. The data is
    updated as needed.",nt"license_title": null,nt"extras": [{ntt"key":
